namespace RonSijm.FluidHumidifier.Factories.QBusiness;

public class ApplicationFactory(string resourceName = null, Action<Humidifier.QBusiness.Application> factoryAction = null) : ResourceFactory<Humidifier.QBusiness.Application>(resourceName)
{

    internal InnerApplicationEncryptionConfigurationFactory EncryptionConfigurationFactory { get; set; }

    internal InnerApplicationAttachmentsConfigurationFactory AttachmentsConfigurationFactory { get; set; }

    internal InnerApplicationPersonalizationConfigurationFactory PersonalizationConfigurationFactory { get; set; }

    internal InnerApplicationAutoSubscriptionConfigurationFactory AutoSubscriptionConfigurationFactory { get; set; }

    internal InnerApplicationQAppsConfigurationFactory QAppsConfigurationFactory { get; set; }

    protected override Humidifier.QBusiness.Application Create()
    {
        var applicationResult = CreateApplication();
        factoryAction?.Invoke(applicationResult);

        return applicationResult;
    }

    private Humidifier.QBusiness.Application CreateApplication()
    {
        var applicationResult = new Humidifier.QBusiness.Application
        {
            GivenName = InputResourceName,
        };

        return applicationResult;
    }
    public override void CreateChildren(Humidifier.QBusiness.Application result)
    {
        base.CreateChildren(result);

        result.EncryptionConfiguration ??= EncryptionConfigurationFactory?.Build();
        result.AttachmentsConfiguration ??= AttachmentsConfigurationFactory?.Build();
        result.PersonalizationConfiguration ??= PersonalizationConfigurationFactory?.Build();
        result.AutoSubscriptionConfiguration ??= AutoSubscriptionConfigurationFactory?.Build();
        result.QAppsConfiguration ??= QAppsConfigurationFactory?.Build();
    }

} // End Of Class

